function sendInitalPacket(data){
	let packet = [];

	packet[0x00]   = 0x00;
	packet[0x01]   = 8;
	packet[0x02]   = 6;
	packet[0x03]   = 0;
	packet[0x04]   = 0x71;
	packet[0x05]   = 0x01;
	packet[0x06]   = 0;
	packet[0x07]   = 0;
	packet[0x08]   = 0;
	packet[0x09]   = 0;
	packet[10]   = 0;
	packet[11]   = 0;

	packet = packet.concat(data);

	device.write(packet, 65);
}

function StreamDoublePacket(data1, data2, space1, space2){
	let packet = [];

	packet[0x00]   = 0x00;
	packet[0x01]   = 8;
	packet[0x02]   = 7;
	packet[0x03]   = 0;

	packet = packet.concat(new Array(space1).fill(0));
	packet = packet.concat(data1);
	packet = packet.concat(new Array(space2).fill(0));
	packet = packet.concat(data2);

	device.write(packet, 65);
}

function StreamPacket(space, data){
	let packet = [];

	packet[0x00]   = 0x00;
	packet[0x01]   = 8;
	packet[0x02]   = 7;
	packet[0x03]   = 0;
	packet = packet.concat(new Array(space).fill(0));
	packet = packet.concat(data);

	device.write(packet, 65);
}

